import React from 'react'
import { Link } from "react-router-dom";

const Home = () => {
    return (
        <div>
            <h1>BIENVENIDO A LA OMBD</h1>
            <p>Haz click para loguearte o crearte un usuario!</p>
            <Link> <button type="button" class="btn btn-primary">Ya tengo un usuario creado</button></Link>
            <Link><button type="button" class="btn btn-secondary">Crear usuario</button></Link>
        </div>
    )
}

export default Home
